import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';

import Dashboard from './Dashboard';
import Submission from './Submission';
import Applications from './Submission';
import Properties from './Properties';
import Navbar from './Navbar';
import Apps from './Apps';
import Props from './Props';
import Vends from './Vends';

class App extends Component {
  render() {
    return (
      <Router>
        <React.Fragment>
        <Navbar />
        <Switch>
          <Route component={Dashboard} exact path="/" />
          <Route component={Submission} path="/submission/:submissionId" />
          <Route component={Applications} path="/apps/:appId" />
          <Route component={Properties} path="/jurisdiction/:jurisdictionId" />
          <Route component={Vends} path="/vendors" />
          <Route component={Apps} path="/apps" />
          <Route component={Props} path="/jurisdictions" />
        </Switch>
        </React.Fragment>
      </Router>
    );
  }
}

export default App;
